    <script>
       
        var findDisappearedNumbers = function(nums) {
            var res=[];
            for(var i=0;i<nums.length;i++){
                var temp=nums[i];
                if(nums[i+1]&&nums[i+1]!=nums[i]){
                    var add1=nums[i]+1;
                    while(add1<nums[i+1]){
                        res.push(add1);
                        add1++;
                    }
                }
            }
            return res;
        };
        console.log(findDisappearedNumbers([0,1,2,5,6,9]));
